import axios from 'axios';

function QueueManager({name, status, environment}){
  return(
  <div>
      <nav>
      <table className={styles.queueManagerTable}>
          <tr>
              <th>queue name</th>
              <th>type</th>
              <th>depth</th>
              <th>ambiente</th>
          </tr>            
      </table>
      </nav>
  </div>
  )
}


export default QueueManager;
























